    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_ShutdownAck(Rest2, 0, 0, F, TrUserData).

skip_group_ShutdownAck(Bin, _, Z2, FNum, TrUserData) ->
